%osql

BEGIN
EXECUTE IMMEDIATE 'DROP TABLE mset_sh_settings';
EXECUTE IMMEDIATE 'CREATE TABLE mset_sh_settings( setting_name VARCHAR2(30), 
                               setting_value VARCHAR2(128))';
-- Set Algorithm name                             
INSERT INTO mset_sh_settings VALUES('ALGO_NAME', 'ALGO_MSET_SPRT');
-- Set the memory vector. 
INSERT INTO mset_sh_settings VALUES('MSET_MEMORY_VECTORS', 125); 
INSERT INTO mset_sh_settings VALUES('MSET_ALPHA_PROB', 0.1); 
-- Set the alert count. 
INSERT INTO mset_sh_settings VALUES('MSET_ALERT_COUNT', 5); 
-- Set the alert window.
INSERT INTO mset_sh_settings VALUES('MSET_ALERT_WINDOW', 5); 
